import Link from 'next/link'
import { Button } from 'reactstrap'
import { Nav, NavItem, NavLink } from 'reactstrap';
import Layout from '../components/layout'
import Particles from 'react-particles-js'


const particleOpt = {
  particles: {
    number: {
      value: 150,
      density: {
        enable: true,
        value_area: 800
      },
      move: {
        enable: true,
        speed: 1
      }
    }
  },
  interactivity: {
    events: {
        onhover: {
            enable: true,
            mode: ["push"]
        }
    }
  }
}

function Index(props) {
    return (
      <div>
        <Particles canvasClassName="particle-canvas" params={particleOpt} />
        <Layout>
          <Nav>
            <NavItem>
              <NavLink href="/mycv">Link</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="#">Link</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="#">Another Link</NavLink>
            </NavItem>
            <NavItem>
              <NavLink disabled href="#">Disabled Link</NavLink>
            </NavItem>
          </Nav>
          <div className="wrapper">
            <div className="introduction">
              <h1 className="display-3 text-center hello">Hello, I'm <span>Maicon Esteves</span>.</h1>
              <h2 className="display-3 text-center hello">I'm a full-stack developer.</h2>
              <p className="lead center">
                <Button color="btn btn-lg primary">Learn More</Button>
              </p>
            </div>
          </div>
        </Layout>



      </div>
    );
}

export default Index
